import React from "react";

function DashBoard() {
  return (
    <div style={{ color: "red", flex: 1 }}>
      <h1 className="" >DashBoard</h1>
      <Button variant="primary" onClick={() => handleShowModal("Add Notification")}>
          Add Notification
        </Button>
    </div>
  );
}

export default DashBoard;
